import { Grid, Button, ButtonGroup } from "@material-ui/core";

interface ILogin {
  loginclass: string;
  signupclass: string;
}
export function PcLogin({ loginclass, signupclass }: ILogin) {
  return (
    <Grid container className="containerlogin" item sm={12}>
      <Grid item sm={2} md={3} lg={4}></Grid>
      <Grid item sm={8} md={6} lg={4}>
        <ButtonGroup fullWidth={true}>
          <Button
            className={loginclass}
            variant="outlined"
            size="large"
            color="primary"
          >
            Login
          </Button>
          <Button
            className={signupclass}
            variant="contained"
            size="large"
            color="secondary"
          >
            Signup
          </Button>
        </ButtonGroup>
      </Grid>
    </Grid>
  );
}

export function MobileLogin({ loginclass, signupclass }: ILogin) {
  return (
    <Grid container className="containerloginmobile" item xs={12}>
      <Grid item sm={5}></Grid>
      <Grid item className="buttonpad buttonshake" xs={12} sm={2}>
        <Button
          className={loginclass}
          fullWidth={true}
          variant="outlined"
          size="large"
          color="primary"
        >
          Login
        </Button>
      </Grid>
      <Grid item sm={12}></Grid>

      <Grid item sm={4}></Grid>
      <Grid item className="buttonpad buttonshake" xs={12} sm={4}>
        <Button
          className={signupclass}
          fullWidth={true}
          variant="contained"
          size="large"
          color="secondary"
        >
          {" "}
          Signup
        </Button>
      </Grid>
    </Grid>
  );
}
